// import { createApp } from 'vue'
// import Mymoney from './App.vue'
// import Loginpage from './App.vue'
import Vue from 'vue'
import App from './App'
import router from './router'


// createApp(Mymoney).mount('#mymoney')
// createApp(Loginpage).mount('#loginpage')
Vue.config.productionTip = false
new Vue ({
    el: '#app',
    router,
    components: { App },
    template: '<App/>'
})
